import React from "react";
import "../custom.css";

const teamMembers = [
    {
        name: "John Doe",
        role: "AI Engineer",
        image: "https://via.placeholder.com/150",
        description: "Expert in AI and machine learning with 5+ years of experience.",
    },
    {
        name: "Jane Smith",
        role: "Data Scientist",
        image: "https://via.placeholder.com/150",
        description: "Specializes in data analysis and visualization.",
    },
    {
        name: "Alice Johnson",
        role: "Frontend Developer",
        image: "https://via.placeholder.com/150",
        description: "Passionate about building user-friendly interfaces.",
    },
    {
        name: "Bob Brown",
        role: "Backend Developer",
        image: "https://via.placeholder.com/150",
        description: "Experienced in building scalable backend systems.",
    },
];

const Team = () => {
    return (
        <div className="team-page">
            <div className="hero-section">
                <h1 className="hero-title">Our Team</h1>
                <p className="hero-description">
                    Meet the talented individuals behind IBM Analyzer.
                </p>
            </div>

            <div className="team-grid">
                {teamMembers.map((member, index) => (
                    <div key={index} className="team-card">
                        <img src={member.image} alt={member.name} className="team-image" />
                        <h3 className="team-name">{member.name}</h3>
                        <p className="team-role">{member.role}</p>
                        <p className="team-description">{member.description}</p>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Team;
